// Example in the main file (e.g., App.tsx)
import { Route, BrowserRouter as Router, Routes } from 'react-router-dom';
import Desktop from './Desktop';
import WorkoutDetails from './WorkoutDetails';

const App: React.FC = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Desktop />} />
        <Route path="/workout-details/:workoutName" element={<WorkoutDetails />} />
      </Routes>
    </Router>
  );
};

export default App;
